import { Formik } from 'formik'

const initialValues = {
	repositoryOwner: '',
	repositoryName: '',
	rating: 0,
	review: ''
}

const CreateReviewForm = ({ onSubmit }) => {
	return(
		<Formik
			initialValues={initialValues}	
			onSubmit={onSubmit}
		>

		</Formik>
	)
}

export default CreateReviewForm
